    //         0x6168499c0cFfCaCD319c818142124B7A15E857ab, // VRF Coordinator
    //         0x01BE23585060835E02B77ef475b0Cc51aA1e0709 // LINK Token
    //     )
    // {
    //     keyHash = 0x2ed0feb3e7fd2022120aa84fab1945545a9f2ffc9076fd6156fa96eaff4c1311;
    //     fee = 100000000000000000;
    // }

    function isERC20(address tokenAddress) public view returns (bool) {
        bytes4 erc20InterfaceId = 0x36372b07;
        return ERC165(tokenAddress).supportsInterface(erc20InterfaceId);
    }
}
